import styles from "./Forms.module.css"

export default function AddButtons({onShowCreatedChars, isActiveShowAll}){
    let createdChars = localStorage.getItem('')
    return(
        <div className={styles.character_form}>
            <p className={styles.character_filterTitle}>Created characters actions:</p>
            <div>
                <button className={styles.add_buttons_btn} onClick={onShowCreatedChars}>
                    {isActiveShowAll ? "Show created ones" : "Show all characters"}
                </button>
                <button className={styles.add_buttons_btn}>Delete created ones</button>
            </div>
        </div>
    )
}
